import React from 'react';
import { 
  Box, 
  Typography, 
  Container, 
  Grid, 
  Card, 
  CardContent,
  Avatar,
  Button,
  useTheme 
} from '@mui/material';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import MedicalServicesIcon from '@mui/icons-material/MedicalServices';
import AccessTimeFilledIcon from '@mui/icons-material/AccessTimeFilled';
import VolunteerActivismIcon from '@mui/icons-material/VolunteerActivism';
import VerifiedUserIcon from '@mui/icons-material/VerifiedUser';
import ArrowForwardIcon from '@mui/icons-material/ArrowForward';

// Team members data
const teamMembers = [
  {
    id: 1,
    name: 'Dr. Rajesh Sharma',
    position: 'Medical Director',
    image: '/images/team/doctor-1.jpg',
    description: 'Dr. Sharma has over 15 years of experience in geriatric care and oversees all medical aspects of our services.'
  },
  {
    id: 2,
    name: 'Priya Patel',
    position: 'Head Nurse',
    image: '/images/team/nurse-1.jpg',
    description: 'Priya leads our nursing team with her extensive experience in critical care and home healthcare management.'
  },
  {
    id: 3,
    name: 'Ankit Mishra',
    position: 'Physiotherapist',
    image: '/images/team/physio-1.jpg',
    description: 'Ankit specializes in rehabilitation therapies for elderly patients and post-surgical recovery.'
  }
];

const About = () => {
  const theme = useTheme();
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: { 
      opacity: 1,
      transition: {
        duration: 0.5,
        when: "beforeChildren",
        staggerChildren: 0.1
      }
    }
  };

  const itemVariants = {
    hidden: { y: 20, opacity: 0 },
    visible: { 
      y: 0, 
      opacity: 1,
      transition: { duration: 0.5, ease: "easeOut" }
    }
  };

